import "./Button.css";

function Button() {
	const [showModal, setShowModal] = useState(false);
	const openModal = () => {
		setShowModal((prev) => !prev);
	};

	return (
		<div className="ctForm">
			<button className="btn">Get Quote</button>
		</div>
	);
}
export default Button;
